import React from 'react';

const App = () => {
    
    const state = useState();

    let count = 0;
    
    const IncNum =() => {
        count++;
    }
    

    return(
        <>
        <h1> {count}</h1>
        <button onClick={IncNum}>Click Me!</button>
        </>
    )
   
}

export default App
